import React, { Component } from "react";

class Content extends Component {
    render() {
        const conteudos = [
            {
              conteudo: 'High Order Functions',
              bloco: 8,
              status: 'Aprendido'
            },
            {
              conteudo: 'Composicao de Componentes',
              bloco: 11,
              status: 'Aprendendo',
            },
            {
              conteudo: 'Composicao de Estados',
              bloco: 12,
              status: 'Aprenderei'
            },
            {
              conteudo: 'Redux',
              bloco: 16,
              status: 'Aprenderei'
            },
          ];


        return (
            <ul key="listContent">
                {conteudos.map((e, i) => <li>O conteúdo é: {e.conteudo}{'\n'}
            Status: {e.status}{'\n'}
            Bloco: {e.bloco}</li>)}
            </ul>
        )
    }
}

export default Content
